type Sneakers = {
	id: string;
	name: string;
	img: { preview: string }[];
	info: {
		company: string;
		name: string;
		description: string;
		price: number;
		deal: number;
	};
}[];

function ItemInfo() {
	return (
		<div className=''>
			<div className=''></div>
			<div className=''></div>
			<div className=''></div>
			<div className=''></div>
			<div className=''></div>
			ItemInfo
		</div>
	);
}

export default ItemInfo;
